         {shops.map((data, index)=> {return <div className="col-xs-12 col-sm-6 col-md-4 col-lg-3 cont" key={index}><ProductShops addProductToCart={addProductToCart} user={user} data={data}/></div>})} 
         </div>
      </div>
    </div> 
  )
}
